import Article from './Article.js';
import './Featured.css';

function Featured() {
  return (
    <div className='Featured'>
      <h2><i>Featured Articles</i></h2>
      <div id='Featured'>
        <Article />
        <div id='line'></div>
        <Article />
        <div id='line'></div>
        <Article />
      </div>
    </div>
  );
}

export default Featured;
